import { styled } from '@mui/material/styles';
import { AppBar, IconButton, Toolbar } from '@mui/material';





export default function CustomizedTabs() {


  return (
    <AppBar position='static'>
      <Toolbar>
        <IconButton size='large' edge='start'></IconButton>
      </Toolbar>
    </AppBar>
  );
}
